import React from 'react';
import ProfileContainer from './ProfileContainer';

class Signin extends React.Component {
  render() {
    return(
      <div>
        <h1>Welcome to signin</h1>
        <ProfileContainer />
      </div>
    )
  }
}

export default Signin;
